import React from 'react';

function Home() {
    return (
        <div className="text-center bg-gray-100 py-20">
            <img
                src="/assets/hummingbird.jpg"
                alt="Humming Bird"
                className="w-1/3 mx-auto rounded-lg shadow-md"
            />
            <h1 className="text-4xl font-bold mt-6">Welcome to Humming Bird Consulting!</h1>
            <p className="text-gray-700 mt-4">
                Helping startups soar to success with expert insights and strategies.
            </p>
        </div>
    );
}

export default Home;
